import { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom"; //import { Link } from "react-router-dom"
// import Body from "/Body"

let data = [
  {
    id: "1",
    Title: "Star Wars: Episode V - The Empire Strikes Back",
    Poster:
      "https://m.media-amazon.com/images/M/MV5BYmU1NDRjNDgtMzhiMi00NjZmLTg5NGItZDNiZjU5NTU4OTE0XkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_SX300.jpg"
  },
  {
    id: "2",
    Title: "Star Wars: Episode VI - Return of the Jedi",
    Poster:
      "https://m.media-amazon.com/images/M/MV5BOWZlMjFiYzgtMTUzNC00Y2IzLTk1NTMtZmNhMTczNTk0ODk1XkEyXkFqcGdeQXVyNTAyODkwOQ@@._V1_SX300.jpg"
  },
  {
    id: "3",
    Title: "KGF",
    Poster:
      "https://gumlet.assettype.com/film-companion%2Fimport%2Fwp-content%2Fuploads%2F2022%2F03%2FFC-Toofan-KGF-lead-image-min.jpg?w=1200&auto=format%2Ccompress&ogImage=true&enlarge=true"
  },
  {
    id: "4",
    Title: "RRR",
    Poster:
      ""
  }
];
function Yourbooking() {
  const [movie, setMovie] = useState(data);
  useEffect(() => {
    fetch(data)
      .then((response) => response.json())
      .then((json) => setMovie(json));
  }, []);
  let navigate = useNavigate();

  return (
    <>
      <h1
        style={{
          width: "100%",
          backgroundColor: "blue",
          display: "right",
          alignItems: "right",
          justifyContent: "right",
          height: "80px"
        }}
      >
        MOVIE BOOKING
      </h1>
      <div
        style={{
          display: "flex",
          gap: "40px",
          boxShadow: "1px 1px 1px 1px solid black",
          flexWrap: "wrap"
        }}
      >
        {movie.map((movie) => (
          <div>
            <div
              key={movie.id}
              style={{
                backgroundColor: "white",
                boxShadow: "1px 1px 1px 1px gray",
                display: "flex",
                flexDirection: "column",
                alignItems: "center",
                borderRadius: "18px",
                justifyContent: "center",
                height: "600px",
                width: "300px",
                gap: "8px"
              }}
            >
              <div style={{ width: "80%" }}>
                <h3>{movie.Title}</h3>
              </div>

              <img
                width="250px"
                height="80%"
                src={movie.Poster}
                alt="not found"
              />
              <button
                onClick={() => navigate(`/Body`)}
                style={{
                  backgroundColor: "green",
                  height: "50px",
                  marginBottom: "5px",
                  borderRadius: "5px",
                  border: "none",
                  cursor: "pointer"
                }}
              >
                BOOKING
              </button>
            </div>
          </div>
        ))}
      </div>
    </>
  );
}

export { Yourbooking };
